import React from 'react'
import { useSelector } from "react-redux";
const Countries = () => {
      const countries = useSelector((state) => state.countries);
    return (
        <div>
            {
                countries.map(coutry => (
                    <div>
                        <h1>{coutry.name}</h1>
                    </div>
                ))
            }
        </div>
    )
}

export default ountries;
